import styled from "@emotion/styled";

export const ProfileInformation = styled.div`
    display: flex;
    width: 50em;
    justify-content: space-between;
    padding: 0 3em 0 3em;
`

export const PostWrapper = styled.div`
    display: flex;
    flex-direction: column;
    width: 22em;
    margin-top: 2em;
`

export const ShortModules = styled.div `
    display: flex;
    flex-direction: column;
`
